import './App.css';

const App = () => {
  const mensaje = 'GREETINGS PROFESSOR FALKEN. HOW ARE YOU TODAY?'
  const a = 3.444
  const b = 1.334
  return (
    <div className="App">
      {mensaje + 'FALKKKKEEEENNNN'}
      <br/>
      {+new Date()}

      <h1>App de react</h1>
      <strong>Estamos trabajando...</strong>
      <div>
        <p>El resultado es: </p>
        {a + b}
      </div>
    </div>
  );
}

export default App;
